import React from "react";
import { useFormik } from "formik";
import * as Yup from "yup";
import { useNavigate } from "react-router-dom";
import axios from "axios";
import { toast } from 'react-toastify';

export default function ChangePassword() {
    const navigate = useNavigate();

    async function onChangePassword(values) {
        try {
            const res = await axios.put("http://localhost:3001/passwordreset", {
                email: localStorage.getItem("email"),
                password: values.password
            });

            if (res.status === 200) {
                localStorage.removeItem("email")
                toast.success("Password changed successfully!");
                navigate("/login");
            } else {
                toast.error("Unexpected status in changing password...");
            }
        } catch (err) {
            console.error(err);
            toast.error("Error in changing password.");
        }
    }

    const schema = Yup.object().shape({
        password: Yup.string().min(5, "Password must be at least 6 characters").required("Password is required"),
        confirmPassword: Yup.string().oneOf([Yup.ref('password'), null], "Passwords must match").required("Confirm password is required"),
    });

    const { handleSubmit, values, handleChange, errors, touched, handleBlur } = useFormik({
        initialValues: {
            password: "",
            confirmPassword: "",
        },
        onSubmit: onChangePassword,
        validationSchema: schema,
    });

    return (
        <div className="bg-white w-screen h-screen flex flex-col md:flex-row items-center justify-around p-3 md:p-0">
            <form onSubmit={handleSubmit} className="w-[400px] h-[450px] bg-gray-100 flex flex-col items-center gap-9 rounded-lg md:p-3 md:m-3">
                <header className="flex flex-col justify-center">
                    <h2 className="text-3xl font-bold mt-7 play">Change Password</h2>
                    <img className='h-[100px] w-[150px] self-center' src="data:image/png;base64," alt="logo"/>
                   </header>
                <div>
                    <label className="sr-only" htmlFor="password">New Password</label>
                    <div className="w-72">
                        <div className="relative h-10 w-full min-w-[200px]">
                            <input
                                type="password"
                                placeholder="Enter new password"
                                id="password"
                                name="password"
                                value={values.password}
                                onChange={handleChange}
                                onBlur={handleBlur}
                                className="peer h-full w-full rounded-[7px] pl-4 !border z-[2] !border-gray-300 border-t-transparent bg-gray-200 px-3 py-2.5 font-sans text-sm font-normal text-blue-gray-700 shadow-lg shadow-gray-900/5 outline outline-0 ring-4 ring-transparent transition-all placeholder:text-gray-500 placeholder-shown:border placeholder-shown:border-blue-gray-200 placeholder-shown:border-t-blue-gray-200 focus:border-2 focus:!border-gray-900 focus:border-t-transparent focus:!border-t-gray-900 focus:outline-0 focus:ring-gray-900/10 disabled:border-0 disabled:bg-blue-gray-50"
                            />
                        </div>
                    </div>
                    {errors.password && touched.password && <div className="text-sm text-red-700 h-3">{errors.password}</div>}
                </div>
                <div>
                    <label className="sr-only" htmlFor="confirmPassword">Confirm Password</label>
                    <div className="w-72">
                        <div className="relative h-10 w-full min-w-[200px]">
                            <input
                                type="password"
                                placeholder="Confirm new password"
                                id="confirmPassword"
                                name="confirmPassword"
                                value={values.confirmPassword}
                                onChange={handleChange}
                                onBlur={handleBlur}
                                className="peer h-full w-full rounded-[7px] pl-4 !border z-[2] !border-gray-300 border-t-transparent bg-gray-200 px-3 py-2.5 font-sans text-sm font-normal text-blue-gray-700 shadow-lg shadow-gray-900/5 outline outline-0 ring-4 ring-transparent transition-all placeholder:text-gray-500 placeholder-shown:border placeholder-shown:border-blue-gray-200 placeholder-shown:border-t-blue-gray-200 focus:border-2 focus:!border-gray-900 focus:border-t-transparent focus:!border-t-gray-900 focus:outline-0 focus:ring-gray-900/10 disabled:border-0 disabled:bg-blue-gray-50"
                            />
                        </div>
                    </div>
                    {errors.confirmPassword && touched.confirmPassword && <div className="text-sm text-red-700 h-3">{errors.confirmPassword}</div>}
                </div>
                <button type="submit" className="text-[17px] text-white bg-gradient-to-r from-blue-500 via-blue-600 to-blue-700 hover:bg-gradient-to-br focus:ring-4 focus:outline-none focus:ring-blue-300 dark:focus:ring-blue-800 shadow-lg shadow-blue-500/50 dark:shadow-lg dark:shadow-blue-800/80 font-medium rounded-lg px-5 py-2.5 text-center me-2 mb-2">
                    Change Password
                </button>
            </form>
            <div className="hidden md:block">
                <lottie-player
                    src="https://lottie.host/2e4865f6-8add-4c00-a59c-0706e3699d2e/5bStF8Ce9z.json"
                    background="##fff"
                    speed="1"
                    style={{ width: "700px", height: "700px" }}
                    loop
                    autoplay
                    direction="1"
                    mode="normal"
                ></lottie-player>
            </div>
        </div>
    );
}
